  true,\n\t\"url\": null,\n\t\"notes\": \"This shapefile contains location and attribute
  data for a Geoprobe temperature survey conducted by Geothermal Technical Partners,
  Inc. during 2010. The purpose of direct push technology (u201cDPTu201d) probe activity
  at the McGee Mtn. Project, Nevada was to 1) determine bottom hole temperatures using
  nominal 1.5 inch probe tooling to place resistance temperature detectors (u201cRTDu201d)
  and 2) take water samples, if possible, to characterize the geothermometry of the
  system.nnA total of 23 holes were probed in five days for a cumulative total of
  857.5 ft. at 21 sites at McGee Mountain.  The probed holes ranged in depth from
  a maximum of 75 ft to a minimum of 10 ft and averaged 37.3ft. The average temperature
  of the 23 holes was 18.9u2070C, with a range of 12.0u2070C at site MMTG#1b to 42.0u2070C
  at site MMTG#19. . No water was encountered in any of the probed holes, with the
  exception of MMTG#10, and no water was collected for sampling. Zip file containing
  Arcview shapefile in UTM11 NAD83 projection. 5kb file size.n\",\n\t\"license_title\":
